import axios from 'axios';
import { mapStateToProps } from '../../containers/createTodo.container';

const submit = (event) => {
    event.preventDefault();

    const newTodo = {
        todoDescription: mapStateToProps.todoDescription,
        todoResponsible: mapStateToProps.todoResponsible,
        todoPriority: mapStateToProps.todoPriority,
        todoCompleted: mapStateToProps.todoCompleted 
    }

    return {type: 'submit'}
}

export default submit;
